import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <h1 className="home-title">Welcome!</h1>
      <div className="home-buttons">
        <button className="home-button" onClick={() => navigate('/history')}>
          History Chat
        </button>
        <button className="home-button" onClick={() => navigate('/chat/1')}>
          Chat with Gemini
        </button>
      </div>
    </div>
  );
};

export default Home;
